#include <vector>
#include <unordered_map>
#include <cmath>

using namespace std;

class Solution {
public:
    long long maximumSum(vector<int>& nums) {
        unordered_map<long long, long long> freq;
        for (int num : nums) {
            long long mask = 0;
            for (long long i = 2; i * i <= num; ++i) {
                if (num % i == 0) {
                    int count = 0;
                    while (num % i == 0) {
                        num /= i;
                        ++count;
                    }
                    if (count % 2) mask ^= i;
                }
            }
            if (num > 1) mask ^= num;
            freq[mask] += num;
        }

        long long result = 0;
        for (const auto& [mask, sum] : freq) {
            result = max(result, sum);
        }
        return result;
    }
};
